icated to the empowerment of Black lesbian, gay, bisexual, transgender, and queer (LGBTQ) people, including people living with HIV/AIDS (PLWHA). NBJC's mission is to end racism, homophobia, and LGBTQ bias and stigma. As America's leading national Black LGBTQ civil rights organization focused on federal public policy, NBJC has accepted the charge to lead Black families in strengthening the bonds and bridging the gaps between the movements for racial justice and LGBTQ equality.    Since 2003, NBJC has provided leadership at the intersection of national civil rights groups and LGBTQ organizations, advocating for the unique challenges and needs of the African American LGBTQ community that are often relegated to the sidelines. NBJC envisions a world where all people are fully-empowered to participate safely, openly, and honestly in family, faith, and community, regardless of race, class, gender identity, or sexual orientation. NBJC's programmatic work aims to build partnerships and provide cultural competency training and education moving beyond tokenization to more intentional diversity and inclusion strategies in both African American spaces and in LGBTQ spaces.  "},"showMoreText":{"simpleText":"show more"},"showLessText":{"simpleText":"show less"},"creatorMessages":[{"thumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/a/AATXAJyNO3_VfGerlcWvCHKEpaFfrDaCTEUeUlDGXqgdVA=s128-c-k-c0xffffffff-no-rj-mo"}]},"title":{"runs":[{"text":"The Daily Show with Trevor Noah","bold":true},{"text":", organizer"}]},"description":{"simpleText":"The National Black Justice Coalition (NBJC) is a civil rights organization dedicated to the empowerment of Black lesbian, gay, bisexual, transgender, and queer people, including people living with HIV/AIDS. With a focus on federal public policy, NBJC’s mission is to end racism, homophobia, and LGBTQ bias \u0026 stigma, and to bridge the gaps between the movements for racial justice and LGBTQ equality."}}],"headerTitle":{"simpleText":"Donate now
